description:
Nullsoft Winamp is a fast, flexible, high-fidelity music and video player 
for Windows. Winamp supports MP3, CD, WAV and other audio formats, 
custom appearances called skins, plus audio visualization and audio effect 
plug-ins. additional features including free-form skins, a new decoder, 
built-in cross fade, and an advanced Media Library

